import "./App.css";
import React, { useState, useEffect } from "react";

function App() {
  const url = "http://localhost:8000/albums";
  const [data, setData] = useState([]);

  const fetchInfo = () => {
    return fetch(url)
      .then((res) => res.json())
      .then((d) => setData(d))
  }


  useEffect(() => {
    fetchInfo();
  }, []);

  return (
    <div className="App">
      <center>
        {data.map((dataObj, index) => {
          return (
            <div
              style={{
                width: "15em",
                backgroundColor: "#35D841",
                padding: 2,
                borderRadius: 10,
                marginBlock: 10,
              }}
            >
              <a href=" "    style={{ fontSize: 20, color: 'white' }}>{dataObj.name}</a>
            </div>
          );
        })}
      </center>
    </div>
  );
}

export default App;
